// https://eips.ethereum.org/EIPS/eip-20
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

contract KennyCoin {
  mapping(address => uint256) public balances;
  mapping(address => mapping(address => uint256)) public allowed;

  constructor(uint256 initialAmount) {
    balances[msg.sender] = initialAmount;
  }

  // allowed[address(this)][address(this)] = MAX_UINT256;
  event Transfer(address indexed _from, address indexed _to, uint256 _value);
  event Approval(
    address indexed _owner,
    address indexed _spender,
    uint256 _value
  );

  function transfer(address _to, uint256 _value) public returns (bool success) {
    require(
      balances[msg.sender] >= _value,
      "token balance is lower than the value requested"
    );
    emit Transfer(msg.sender, _to, _value);
    balances[msg.sender] -= _value;
    balances[_to] += _value;
    return true;
  }

  function transferFrom(
    address _from,
    address _to,
    uint256 _value
  ) public returns (bool success) {
    uint256 allowance_amount = allowed[_from][msg.sender];
    require(
      balances[_from] >= _value && allowance_amount >= _value,
      "token balance or allowance is lower than amount requested"
    );
    balances[_to] += _value;
    balances[_from] -= _value;
    allowed[_from][msg.sender] -= _value;
    emit Transfer(_from, _to, _value);
    return true;
  }

  function getBalance(address _owner) public view returns (uint256 balance) {
    return balances[_owner];
  }

  function approve(address _spender, uint256 _value)
    public
    returns (bool success)
  {
    allowed[msg.sender][_spender] = _value;
    emit Approval(msg.sender, _spender, _value);
    return true;
  }

  function allowance(address _owner, address _spender)
    public
    view
    returns (uint256 remaining)
  {
    return allowed[_owner][_spender];
  }
}
